import React from 'react'
import 'semantic-ui/dist/semantic.min.css';
import Empheader from './empheader'
import '../Managerpg2/Managermain2.css'
import ManagerFooter from "../Managerpg1/ManagerFooter";
import axios from 'axios'
import { Form, TextArea,Button,Segment,Label,Icon } from 'semantic-ui-react';
import {Redirect} from "react-router-dom";
import apiconstants from '../employee/config';


var bgColors = {
    "Default": "#81b71a",
    "Blue": "#00B1E1",

    "Cyan": "#",
    "Green": "#8CC152",
    "Red": "#E9573F",
    "Yellow": "#d3d3d3",
};

class Empmain4 extends React.Component {

        constructor() {
          super();
          this.state = {
            id:1,

            goals: [] };

        }
        componentWillMount() {
          let id=this.props.match.params.id
          let month=this.props.match.params.month
          const response = axios({
              method: 'GET',
              url:apiconstants.URL+`viewgoal/${id}/${month}`,
          })
          .then(res =>{
this.setState({goals:res.data})
console.log(res.data)

        })
      }

      setRedirect1 =(e) => {
        this.setState({
            redirect1: true
        })   
    }  

        render() {
            {
              if (this.state.redirect1) {
                  return <Redirect to={"/month-feedback" +"/"+ this.props.match.params.id +"/"+ this.props.match.params.emp + "/" + this.props.match.params.month}/>;

              }
          }
          return (
            <div className="manbg">
                  <Empheader idd={this.props.match.params.id} />
                <br/>
                <br/>
                <Label size='large' right style={{color:"black",width :"auto"}} ><Icon name='user' />
      {this.props.match.params.emp}
    </Label> 
                <br/>
                {this.state.goals.map(el => (

                      <Form style={{paddingLeft:"10%"}} className="form1">

                                  <TextArea  style={{color:"black",backgroundColor: bgColors,width:"400px",height:"40px"}}

                                            value={el.goal}/>


                                 <input type='date' style={{color:"black",width:"auto"}}


                                           value=  {el.goaltime}

                                           />
                                           <br />    


                    </Form>



                ))}

<br/>

<button onClick={this.setRedirect1}
                            style={{ width :"auto",}}
                            className="ui blue button"><Icon name="arrow circle left" />Go Back</button>
<br/>
<br/>
                <ManagerFooter/>

            </div>
          );
        }
      }

export default Empmain4;
